import React from 'react';
import { Button, Icon, Container } from 'semantic-ui-react';
import GifImage from '../utils/thanks2.gif';

const ThanksPage = () => {
  return (
    <Container
      textAlign="center"
      style={{ margin: '2em', backgroundImage: `url(${'images/image_03-1024x320.jpg'})` }}
    >
      <Button animated>
        <Button.Content visible>Go Default Page</Button.Content>
        <Button.Content hidden>
          <Icon name="arrow left" />
        </Button.Content>
      </Button>
    </Container>
  );
};

export default ThanksPage;
